import React, { Component } from "react";
import "./spotify.css";

class Spotify extends Component {
  render() {
    return (
      <div class="container">
        <h2>Spotify</h2>
        <div class="activity-card">
        </div>
      </div>
    );
  }
}

export default Spotify;
